// openagi-app/src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MainPage from './pages/MainPage';
import StacksPage from './pages/StacksPage';
import StackDetailPage from 'openagi_app\src\pages\StacksDetailPage.js';
import BuildStackPage from './pages/BuildStackPage';
import RunStackPage from './pages/RunStackPage';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<MainPage/>} />
        <Route path="/stacks" element={<StacksPage/>} />
        <Route path="/stack/:id" element={<StackDetailPage/>} />
        <Route path="/build/:id" element={<BuildStackPage/>} />
        <Route path="/run/:id" element={<RunStackPage/>} />
      </Routes>
    </Router>
  );
};

export default App;
